import React from 'react';

function Footer() {
  return (
    <footer className="bg-gray-200 p-4 mt-8">
      <div className="container mx-auto flex justify-between items-center">

        <div>
          <p className="text-sm text-gray-600">API Version 1.0</p>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
